import "./App.css";
import Gameboard from "./components/Gameboard.tsx";
import { deck } from "./utils/Deck";

function App() {
  const startDeck = deck;
  return (
    <div className="App">
      <Gameboard deck={startDeck} />
      <div>CONTAINER FOR LEADERBOARD AND BUTTON</div>
    </div>
  );
}

export default App;
